INSERT INTO `lucky_table` VALUES (1,'寒风水冷隐作痛，鸡犬相闻闹晨曦。','1','寒风兼具水冷，若身体抱恙要多加保重，静养便可痊愈。路上鸡飞狗跳，绕想必是烦心，便隐居避世。但只需静心调摄，与世无争，不日庭院便是怡人美景。'),(2,'孤魂野鬼欲过岸，三途川上水湍湍。','1','得此签者，常一人独战，此刻当注意结伴同行，与亲友共同御敌，恐怕只身一人有所损伤。若难料战况如何，当量力而为，亦可主动寻求帮助，兼听则明。八百比丘尼曾求得此签。'),(3,'阳间琵琶阴司鼓，阴阳相伴奏人心。','1','喜乐之事，难能可贵，心有忧虑，不可鲁莽。阴阳相间，易见人心真相，也不妨自省，常有得益。琵琶与鼓相奏，是放松心情的好时机，常听雅乐可增加运势。晴明曾中此签。'),(4,'平川多弯路，湍湍不可行，旱池见钓叟，饶是有活鱼。','1','平川却见弯路，旱池仍有活鱼，此签祸福相依，祸福相转。绝境中留有一线生机，顺境里也常风起云涌，若只顾眼前，容易错失大局之势。需多多注意祸福反转、阴阳颠倒之时，按计划行事便可平安度过。'),(5,'空穴来风何须有，谣诼恶语伤人心。','1','此签虽指谣言恶语，实则趋吉避凶。流言蜚语常在，时运无常，但有所察觉，便有保全之法。常怀善念，常行善举，任那魑魅游荡，自得一身正气。'),(6,'袅袅青烟破山行，远近路人皆称奇。','1','青烟由山而出，此景虽怡情，却暗含风险。林中有火不安定，可多息事宁人，平静己心，切勿冲动行事。至于多多汲水，可改运势，家中摆放鱼缸，养殖金鱼，可以陶冶性情。'),(7,'年年共赏百花盛，常恨此景太匆匆。','1','光阴匆匆，不论百花盛开、星光璀璨，世人常叹落幕时。得此签者有所忧心，莫要愁眉苦脸，若待轮回至，好景如常，佳人如昔。只需静候时刻来临，不急不缓，可有展眉之时。'),(8,'黄泉不识旧园梦，此去只留缥缈人。','1','旧梦当留旧年，此路已开，孟婆汤悄然备上。若是不舍旧物，新年不见新气象，谓之得不偿失，本末倒置。求签者需有所转变，一尝新果，方知何事可行。'),(9,'蟋蟀唧唧人自咏，秋夜寥寥思未尽。','1','心中有所思，盼有着落，于是便遇蟋蟀叫，亦常自叹自怜。蟋蟀未带奇妙事，秋夜却有尽头，思念最终得成果，少年无需白了头。得此签者不如驱赶蟋蟀，去除烦音，平静待天明。'),(10,'松虫鸣叫，忍草荒乱。良人归故，一扫而光。','1','许久未归，庭院杂乱易长草，今日归来，当即除草捉虫，重新修整一番。若是旧业可重操，若是旧居可打扫，游子归家常问候，重翻旧物亦有得益。可将此签赠与旧友，莫道前程忘了谁。'),(11,'夕暮吹拂探我者，山间诸石响不停。','1','有风来探，福童子欲来不到，诸事将成未成，前路似明非明。此刻谨记有出有入，诸石齐响，异象之下藏金银，多多注意脚下能四平八稳。传说石中有精怪，藏于声响中，有此运者甚少。'),(12,'逝萤高飞，将触彼端。夏日漫漫，窗饰结霜。','1','萤火虫常绕林中，此去高飞，竟触彼端，又有夏日结霜。需注意周遭变化之事，不可料见，当走寻常之路，便可挡灾。此签源于一则奇谈，只是茫茫未可知。'),(13,'清风徐徐，来去难控。亦无缝隙，不入珠帘。','1','纵然清风一股劲，自由来去难料行踪，窗前有珠帘，若想靠近难寻路径。勉强难有福，可多见机行事，灵活如蛇便不怕巨山在前。亦可庭前收卷帘，迎风入室一气呵成。'),(14,'煮盐孤人家，芦屋滩上忙。黄杨未及梳，小栉深藏柜。','1','小户人家多有杂事忙，便是悠然自得小屋，亦需煮盐梳黄杨。此番忙完，当即休息，自养精神，恢复精神。亦可到户外一走，看看周遭四处，游历一番长才智。'),(15,'白露无形，消散无情。误作珍珠，梦中结串。','1','白露只是一场梦，抓不住留不住，若得浮影莫生眷恋，随之消散而去。真诚求珍珠，毋庸梦中求，不日清醒，要得实在宝物。有人听鼓声见白露，便遇蝴蝶精，此梦迷人，但不得法。'),(16,'万物染千色，秋时覆天地。冬雨空有寒，何物可沾颜。','1','秋时万物染千色，可红可紫，美景胜收。却到冬日有寒雨，天地之间灰冷无艳。轮回无常，若前日有喜，当今日有所克制，修炼己身以度冬日。可将卧室床被晾晒于横梁，祛除湿气，待时运反转。'),(17,'山火烧不尽，何人困烟熏。心念追何事，当随小溪行。','1','山火烟熏困人于此，若是求何事何物，当绕此烟行，随清水小溪寻觅结果。踌躇不前怕惹火上身，畏惧退缩，只恐呼吸更难。溪流近在眼前，还需细细观察。亦有人言若见河童，便知水源何处。'),(18,'红叶染衣袖，无根亦无痕。随潮打浪去，汐平在今宵。','1','世事缘起缘落，能得一时风景，纵是红叶自身亦难留。凡事顺风顺水，那是最妙，不知何时浪平静，风起云涌莫渡河。一盏纸灯托付于河水，此去若遇鲤鱼精途中相送，梦终成真。'),(19,'春野马脱缰，何以更堪忧。娴熟马自来，君言化作行。','1','春日天正好，野马随性便脱缰，平安度此日，马便自来，言出必行。莫许空誓言，莫骗脱缰马，草原良驱有几何，相伴当相随。曾有得此签者却遇鹿形妖，为一笑谈。'),(20,'草木秋日褪绿意，大海白浪沫不改。','1','若秋日来临，一边草木枯黄，一边白浪不改，诸事亦有阴阳面，善恶好坏相伴相随。福祸若相依，此刻便由喜事近，多加准备有储粮，冬日亦无害。若庭院落叶积满地，当常常清扫，多多益善。'),(21,'鸟踏龙胆，庭院花散。至于野原，何不逍遥。','1','此鸟不知何处来，竟将庭院花散落，驱赶至野原，亦可散心得逍遥。结界需得重新开，护院莫等闲，亦可守于庭院，防那恶鸟小鬼。龙胆亦为源氏家纹，至于源家有何变故，可求告神明。'),(22,'蝉衣褪去，金壳犹在，睹物思人，此情可追。','2','世人恐惧，皆因未知，金蝉脱壳，可知日后生死?所留之物亦非残羹，乃是至宝，若有离别当好好践行。百般之事，船到桥头自然直。'),(23,'贫苦何时渐转运，宝财贵地得再通。','2','心有愁苦，得此签皆可放下心头大石。只是宝地不可识，宝财不可算，好运随身不可见，事可成，法不可见。缺何物，得何物，若依旧心中郁结，又是得不偿失。'),(24,'黄莺至今不啼春，纵然春至不知晓。','2','黄莺啼春乃正事，此时不啼待何时。缘是平日有闲情，又无烦事挂心头，便忘了本命。人间美景百般，行诸事，可多加用心，便知初春已到。'),(25,'投石问路清光照，不知百鬼道何从。','2','前路漫漫，雾里看花，莫说百鬼不知道何从，人间少有明白事。于是有人投石问路，以为清脆回响，竟有月光指明，于是道路通畅。金鱼姬曾求得此签。'),(26,'梁上日光化冰柱，却说冻土不消融。','2','日光映照，饶是冰柱亦能解。只是水滴从梁子滴下，冻土依旧含冰，所求之事进展一半，需处理零碎。大局已定，不可回头，诸事径直走下去便可。'),(27,'梓弓微张春雨降，若菜何以无人摘。','2','此签指明好运，却要多加小心。若有晦气霉运，梓弓治鬼可消灾，所堵之路畅通，所行之事得益。多食蔬菜即神清气爽。只是良机不独生，要记得兼听则明，则有好事成双。'),(28,'春意不知处，落花为水流。溯溪众逆行，山中有深意。','2','所求之物已安放其中，只是春意难寻，落花亦随流水去。可见所藏之物，需塞井夷灶，逆水行舟，山中之意山中求，莫怕行路多崎岖。有传诗人行山路，曾见兔与山妖作伴，为一奇谈。'),(29,'河鹿蛙几声，井手山吹零。只恨来时晚，今无花盛时。','2','虽花开之时已过，恨来时晚，却听河边鸣叫，清脆悦耳。此为河鹿蛙啼，声响奇妙，宝物虽难眼见，但能耳闻。若是常听笙乐，可扫晦气，振作精神。'),(30,'小雀心有青云志，临泉好事始总总。','2','此签助有志者得强运，可见雏鸟虽小，却在飞翔之时得清泉，解口干舌燥之苦，得力再上青天。于是假以时日，必展翅腾飞，成就大鹏翱翔之事业。得此签可顺势而为，一展宏图，望有所成。'),(31,'客初来，花橘可借宿。雾渐开，羁旅驻一时。','2','人在旅途，遭浓雾所困，踌躇不前意难决。初来此地，心有不安，也无需惊惶，因得好客主人招待，此路又见转机。停一时，能往前百步，运至此可得良机。求签者可整顿卧室，精神焕发。'),(32,'浮动最无常，人心不知衷。花香一如故，此地当久留。','2','得此签者遇福地，人心难明，唯有此山不移，此地不改。变化莫测，己身亦无常，最怕飞蛾扑火一场空，徒留悲伤。若闻花香，可留此地，静候佳音，以不变应万变。传白藏主亦曾求得此签。'),(33,'磊落不残败，散尽又重来。终末果未至，延存世中花。','2','行事不遮不掩，便是见众花已谢，亦可不日复开。而那日子未到，那花依旧盛开，冷暖自知，静候佳音。得此签者可修剪花枝，收拾居室，便可增运势，强身健魄。'),(34,'居帘层层，遮风挡日。俄然迁转，心焦寻樱。','2','日晒雨淋，邪魔恶鬼难进。窗外景色好与坏，此刻居帘挡未知。得此签者可享平安，无灾无病，却可惜了春日樱花，人间极乐之事难寻。若卷起家中帘，常透日光，或是出游散心，便有好事敲门。'),(35,'苦思久待终不来，黄莺立花相顾啼。','2','所求之事，不似预期却也风生水起。天下道路千万，未必从一而终，时常柳暗花明之处，活水源泉奔涌而至。黄莺报喜，花开富贵，可沐浴更衣、净手煴香，迎待喜事。'),(36,'朝露濡衣袖，海船入港来。两看相不厌，此去流汪洋。','2','朝露于内陆自生，船只从大海驶进，两两相融流入汪洋。工作学习如有神助，与人交往如鱼得水，各路运程畅通无阻。但切勿孤军奋战，还需协力同心，破除万难。传鬼使白曾路上拾得此签。'),(37,'天涯再重逢，一如昨日雨。水流急匆匆，难截亦难明。','2','重逢喜事精神爽，如沐春雨喜成双。得此签者好事成双，甚至兼济天下，常遇良人。只是意气风发之时，当注意脚下河道平安，若是不可一世，小心踏空。传雨女曾以此签告诫众人。'),(38,'风吹萧萧，浪起彼岸。夜半无人，已近破晓。','2','彻夜无眠所为何事，当知此去是好运乘风而来。风萧萧，如幻如梦，却不见彼岸是那福运小童子，若是心忧，不必如此。传雨女曾求得此签。'),(39,'盆中有影，似花似梦。此影无二，君相本明。','2','盆中见己影，更识己本相，莫道那是梦境一场。近日有契机，重度己身，于是命中改数，好运从天而降。得此签者，可整理浴室，修整己容，以求好运早临。'),(40,'枫叶何所知，朝夕风音速。驻足倾听者，便知谷满仓。','2','兵马未动，粮草先行，谷物满仓，乃千军凯旋之兆。但此事障目不清，眼未能见，何事阻拦走走停停，当除此阴气。可剪窗外枝叶，扫清庭院尘埃。'),(41,'木叶水影相交织，月光斑驳解忧情。','2','木叶与水影为伴，悠闲至极，便是忧愁满心亦有所缓解。及至月光落下，洗净人心，万事有出路，可稍心安。今夜宜当窗映月，运从天来，入夜好眠。传此签为辉夜姬所留。'),(42,'真夜更深，太虚挂月。雁音不断，聚首此空。','2','太虚不可名，形不可定，有雁聚顶，当是超脱物象盛世来。只是盛世亦可乱，人如浮萍，谨慎而行就有升迁之路。有大师曾观天象，识此太虚，欲为天下事，风云变幻。'),(43,'古枝一展咲，本心今又苏。将末不能忘，思忆此秋荻。','2','常说新人笑旧人哭，古枝却有花咲。归去仍少年，此心不改志长存。旧事多成就，旧友情谊深，旧年芳华恒久存，万事万物待复生。中得此签者，重操旧业多惊喜。'),(44,'紫草皆可爱，姐妹本同根。对岸不相见，镜中是何人。','2','紫草若是同根生，此岸彼岸相照映，不料对岸不相见，恐怕此身已相融。本有分离，从此相聚，若有穷乏，亦可补完。得此签者常有圆满之事。传说此签为双生之精怪所持，后流到人间。'),(45,'币帛结成串，旁身戴平安。清风随梦去，留得鱼肉香。','2','铜币结成串，钱财可避灾，纵然路上多鬼怪，只顾着低头数算人间事，众鬼便也随风去。在外劳碌心烦，不如自宅温暖一汤，饱腹以后，顺心顺意。得此签可下厨烹饪，煮一佳肴，拒鬼千里之外。'),(46,'泥沼难行，菖蒲待采。荒郊茫茫，猎稚闻声。','2','纵有泥沼荒郊，亦挡不住采集狩猎者，坚毅前行不可挡。得此签虽无天降大运，也需踏实寻求，求有所得，祛病挡灾。传有猎户，不论寒天酷暑，行至荒野，遂得见神兽，福运双临。'),(47,'三津湾上舟几多，渡海恰似度浮世。','2','舟满港湾，寸步难移，浮世度日，人有无常。此舟若要渡海，无风亦无浪，辗转多时停留于此，心焦急躁。当可大开前门后院，迎那风浪进旧屋，当吹起新气，生生不息。金鱼姬征服之旅亦曾到三津湾一游。'),(48,'花开又花落，世间本无花。易落最为美，人世亦如此。','2','世间无花亦无常，只见花咲展眼舒眉，怕离别，哀愁思。不过此景最美，少些吁叹多坦然，人间喜乐可品尝。得此签宜多扫庭院，清除落花败叶，不日便见新气象。'),(49,'何以留客，皑皑白雪。夏日炎气，寸刻难待。','2','冬日有雪夏炎火，冷热交替无所适从。若想留住贵人，炎气催敢汗直流，谓之不可取。当有片片白雪，美景胜收，留客度此宵。当留意莫雪上留霜，亦感寒冷。传闻雪中亦有白衣少女，不知何人变幻。'),(50,'星星又似水边萤，渔火点点映宿居。','2','行路在外，需寻得寄宿之地，此地有火如星，似荧光火虫，乃是平安福运宝地。不愁落魄无落脚，安心驻足再起行，此去心想事成，盆丰钵满。若见长盛不衰之火，亦无需惊惶，此乃运之所至。'),(51,'浪起海岩湿，青蛙啼稻田。雨落衣不干，此夜水漫屋。','2','水涨船高，层层叠浪，何事满溢到此屋。若是福运已至，或得喜事轮番，如夜雨延绵不绝，扑面而来。但此雨只怕衣不干，当注意庭院屋梁，莫让湿气入侵。'),(52,'海边老松树，悠悠几参天。盛世当不知，古今不曾休。','2','有人求问，老松树摇摇欲坠，可有参天之日，年岁几何。此刻神明回答，盛世不知几回，古今从不停歇。若遇见此树，虔诚祈福，有福分予众人，莫笑老态龙钟，不识品相。'),(53,'质若碧玉，纹理若锦。玉匣拙盖，仍难相映。','2','此玉上乘，唯玉匣不相映，无处寄托自怜此命。或以为自重，无需托付何物，宝玉剔透自有光泽，于日光之下见本相。得此签切勿所托非人，行诸事当亲力亲为。'),(54,'种菊何须岁岁说，金秋一展最平安。','2','田中种菊得自在，常有老汉在旁鸣。只待金秋，此菊应平安。难明彼此，便是各自耕种，明日开花可得其果。如获良言需常听，若有闲语便是一笑置之。'),(55,'蒲柳本寻常，一朝承恩至。玉露白降夜，乍现忽又失。','2','平静之日，有财宝福禄从天而降，此夜白光遮眼，忽又消失。好运犹如昙花，停留一刹那，有道刹那是永恒，千载难逢当及时行乐。犹豫不前，一朝醒来不过寻常蒲柳，又归平静。'),(56,'旷野碧无垠，原上萱草青。茫茫风无相，故人衣袂香。','2','旷野有甘露，有宝物，只是一片碧绿无边无际，饶是寻觅不知所去。微风亦不指路，却闻故人旧时香，连忙相见问前程，犹如夜中明灯、云霄鹊桥。得此签求得好人缘，可与亲友闯四方，斩百鬼。'),(57,'化身明月，流光千里。云上追逐，地无人烟。','2','明月挂天上，流光美景胜人间，于是人人追逐云上风景，地上无人烟。此签热闹非凡，熙熙攘攘，天公相照指引明路，纵然失足有人伸手相助。若只影远行可当注意，结伴同游岂不乐哉?'),(58,'枯松依孤宅，何处寻得主。矗立风雨中，好似过千年。','2','松树已枯，家宅孤立，无主亦无鬼，悄然矗立。形虽土灰，却道这千年风雨，亦难破此树此宅，结界坚固神鬼难近。得此签便有平安，纵然天下大乱，亦可守此身此心。'),(59,'山中流言成是非，白云一去无霜寒。','2','都说恶语伤人六月寒，饶是隐居山中，流言是非无孔不入。此签能躲避是非之事，兼驱鬼辟邪，使得那恶毒匕首一一落空，自得清闲乐。可以琴瑟鼓乐替代流言之声，阻挡霉运，修身养性。'),(60,'操斧制木具，音哑难为听。世人多低语，流言更烦心。','2','天下至恶杂音，莫过于人言，便是比那斧头咿呀更可怕。若无他法，亦可专心打磨，三省自身，将那闲言挡于门外，待出山之日，那器具已成天下至宝。所谓工匠之心，莫过于天崩地裂，亦难阻其专心致志。'),(61,'父母痴傻态，前后乱心怀。莫笑暗夜起，为儿女徘徊。','2','为人父母有难处，白发忽已满头，莫道再等三刻钟，若有所想当立即言之。亦或要为自己的儿女有所操心，只盼那崽茁壮成长、一生平安。若求得此签，将遇得式神，签订此生契约。'),(62,'海藻盛年，划船割取。望海无垠，当盼来年。','2','天下之物莫不为己所用，得天独厚之地，伸手即可触碰。此去虽仅存孤舟，却能乘风破浪，若是采所求之物，不贪不怨，便足以丰收。盛年可遇不可求，把握时机，当下方有良缘。'),(63,'深山松不移，坚心莫枯萎。夜半有凝露，朝日先识珠。','2','常于深山独一客，心若坚定虔诚，不易枯萎，且那凝露可识朝日初生。幽暗长夜已过去，当下立转运，病自愈，财满盘，桃花开。得此签可扫庭院落叶，迎喜气。'),(64,'白川见底，清清可见。露水易逝，浪花常存。','2','水有浊有清，浊者难见其心，清者乃至无鱼，涌流片浪无杂质。有屈能伸冤，有梦可成真，此心由天地所鉴，人间正道常有运。另有一川名荒川，昌盛繁华，亦与白川有所相似。'),(65,'熊熊之火，燃尽此身。碎藻烟起，冲天为云。','2','火不知从何来，有燃尽万物之势，此烟腾升却能冲天化为云。此运来之奇特，非同寻常，若遇风则名扬天下，若得雨则混为一体。有人曾闻此火与京都轶闻相关，知情者甚少。'),(66,'芳庭积尘屑，风吹可扫除。花草见阳日，园丁舒展眉。','2','尘埃遮挡日光，此风来扫除，便使主人家轻松快活。好运如此风，晦气通通消散，即便是陈年难除污秽，亦可趁此机会请出门外。主人亦可对庭院多加打点，好让风神喜入内。'),(67,'行人皆争赏，此花傲立庭。栽菊有深意，为君无人守。','2','种花得馨香，众人路过亦驻足观赏，在此院中花傲立。园丁常有所行，种瓜得瓜，加以诚心，金银财宝、平安富贵皆能从地长。但要小心花开之时，防有贪恋之辈觊觎此花，当谨记在心。'),(68,'逢坂之关，盛名非虚。关川虽浅，湍水声急。','2','有名远扬，却无人识见，时候已到，众人皆一改常态。识名之实，川之急，便能得人望，收人心。如虎添翼，吐气扬眉，福缘临门。若数名满天下之人，当下莫过于源氏名门。'),(69,'浓雾漫空迷飞雁，片冈朝原红叶欤。','2','飞雁无惧风，却怕雾弥漫，虽知此去有美景福泽，却不知终点何在。片冈此地有红叶，大雁若能低飞，或待此雾散去，便能见树下金银。阴阳师中有一咒术，亦可破此迷雾之阵，当尽早习得。'),(70,'绚丽之物褪色快，磐石坚韧不移心。','2','所求之物，双双现于此世，一物绚丽多姿，一物坚如磐石。若想长久当取磐石，只是此心需待时日，难急一时。左右为难，不知所措，或将两物同置囊中，谓之最妙。'),(71,'神社净斋中，漫地生葛者。神威保长青，秋色当何如?','2','神社不可饮食，却遍地生葛，矛盾之事多发生，当可从中选其一。有神威可镇恶鬼，祛病魔，赏秋色便得愉悦，遇贵人。不论如何皆无损其身，多多益善。少年晴明曾将此签置于神社。'),(72,'宝石耀光华，照山美不胜。行人顾往来，工匠细细看。','2','宝石竟能照此山，可见金鳞本非池中物，然而行人只顾往来赏光华，唯有工匠识其珍贵。伯乐何处有，便是发光时，得此宝石便财库盈满，衣食无忧。财不可露眼，宜闭锁门窗。'),(73,'弥漫佐保妍似锦，秋露亦难隐红叶。','2','红叶遍布川河大山，何物难掩其色，喜庆冲天阴气难挡。常有小运从天而降，积少成多铺满庭院，步入其中深数尺。亦有行人拾得红叶便入其山，却见鬼女，轻声退去。'),(74,'摯心植花根不枯，心诚明日再咲华。','2','栽种此花不可强求，根难枯，心坚韧，不论此时何如，可盼明日有收成。清风徐徐，雨水渐落，花开结果如仙境之物，美艳天下无双。可将此花栽种庭院，近水楼台，日夜看顾无疏忽。'),(75,'玉露既在折枝存，源远年华长久留。','2','福气易逝，有玉露之形，当将枝头截取留存，如此一来便是永恒不灭之物。此刻能珍藏宝物，勿要待到天明，机不可失，人亦不能回首。所谓长久留，兴许有星辰之神能相伴。'),(76,'滨上风吹小纸片，白浪汹涌沾不湿。','2','海上有一神物，虽是纸片，却任凭海浪拍打，风吹日晒，依然坚韧无比。若心志有此坚定，万事皆有所成，不劳而获，自成奇迹。传说拾得纸片后，灵力涌现，便化人形，日夜清扫庭院。'),(77,'露消顷刻间，不知在何时。步越千年隙，仙境无玉珠。','2','此光景犹如昙花，灿烂一刻难停留，诸事却因此而生，因此而灭。时光可谓敌万物，千年等待刹那间，若眼见机遇，便要放胆前行。传说那缝隙当中，藏着千年神明，不可探寻，不可凝目。'),(78,'此辰菊本金，孰知初霜降。置白惑众客，更觉花怜人。','2','栽种金色却得白，本求一事却得两物，命运常难料，却有意外惊喜。此去寻觅金银，路上却遇百花，便可驻足观赏奇景。花中有妖怪，可保此行平安顺畅。'),(79,'孰人为花栽二朵，缘是池中水倒映。','2','世人栽花或独一，或成群，却少见栽种唯二，池中倒影遭人误解。可见水至清，花美艳，虚幻之境难辨真假，花影如若梦。水面之上，窗镜之前，传闻常有妖怪附身，慧眼可识。'),(80,'芬芳不散，折枝挂墙。缘既未断，再见天宫。','2','离别短暂，此芬芳尚未散去，缘分也未断开，再别应有时。若有所失，他日便能寻回，更莫说那珍贵之物，自然送上。只是亲自断其根拆其骨，还需另当别论。'),(81,'青丝挂高树，散尽枝叶稀。夜间虽不舍，月影照山明。','2','枝叶稀疏，唯有青丝挂树，月影映照更见明亮。生疏之事，久别之人，不日可见本相，明是非，辨黑白。然而高树何以挂青丝，怕是食发鬼所为。'),(82,'茅庵虽简陋，秋来亦丰收。夜半冷气沾，干柴驱湿露。','2','秋收之时，不在茅屋如何，作物从耕地生长，即便寒冷难耐亦可用柴火烧干。纵使旁人看来平平无奇，却不知其中深奥，总有开花结果之日，让人刮目相看。若在田间遇见一两神犬，可知今朝有灵保佑。'),(83,'神御币帛为何物，守护归途思乡人。','2','币帛乃是供奉物，有灵寄生便成守护人。归途之上多有思乡，所思何物皆能得此保佑，莫受风雨阻拦，莫挨百鬼缠绕。若是在阴司，常有鬼魂返人间，不可得神御。'),(84,'一叶水上，知音流告。今日何如，孰人问天?','2','一叶飘于水上，有知音坐船，却求问于天。不识贵人不知路，上天已赐有缘人。求问之事，可交托亲友，解其困惑，助其高飞。宜在家中添置雅物，喜迎知音贵人入内详谈。'),(85,'金马一啼，余波犹存。都城闹声，祥和之年。','2','良驱城中一啼叫，众人皆知好事来，福运长存，并非转眼即逝。都城便是寻常之日，亦人潮涌动热闹非凡，此生不怕孤单寂寥，开门便有客在此。人群之中有鼬鼠出没，夜中常生事，需加小心。'),(86,'白雪降积埋，御雪永不停。道路无人问，滋润土中苗。','2','积雪几尺厚，无人识得雪下苗，正有甘露滋润茁壮成长。假以时日，能成大器，寒冰当中，坚守己心，切勿随风摇摆。一说萤草雪中长，于是生命顽强，无坚不摧。'),(87,'凛冽严冬添寒气，奈良故里胜山间。','2','外界寒风凛冽时，还需自保在宅居，山间虽有好风景，莫常置身危险中。奈良故里亦有雅物，可安心静赏，寒气退去，平安常伴其身。若寒气甚重，可在家中增添柴火，此夜长燃。'),(88,'白波没松山，雪浪浩荡荡。翻越几重岭，万物披冰霜。','2','雪山风景难抵挡，万物霜雪衣，山岭高耸入云，更添几分白。得此签如此雪风，声势浩荡不可停，披荆斩棘将大获全胜。庭院点缀几分白，不仅有格调，更能聚集好运。'),(89,'大雪遮路闭山里，野兽足迹寻径路。','2','前路虽有阻隔，山中却有灵物，此时相助寻觅得见。天降大任，必先劳其筋骨，若到疲乏之时，与灵兽多加亲近，不日瘴气便除。兽中有性烈者，不可过分勉强，性情温和，可常伴相随。'),(90,'冬日草枯，虽盼犹苦。此朝新年，不请自来。','2','冬日草稀疏，若在此时盼绿意，求而不得夜难眠。运气如风，不知何时到，不知何时走，不日将吹春风来，冬日之草亦长芽。此朝新年不寻常，常守自宅便迎来好运。'),(91,'岩根磐石间，穿梭激荡落。白沫胜似玉，无穷延千年。','2','磐石如此坚韧，此根竟能深入其中，激流从天降，亦无畏巨石，相撞得白沫。若有所求物，当如激流岩根，原地捶打千百遍，滴水能穿石。所谓石墙，无非涂壁，可破之。'),(92,'风吹振耳呼百应，山谷回音添其声。','2','时常压抑难得回应，顺风呼喊，此声于山谷回响，久久不绝。或出于腼腆，或出于难言，若不发声何以求问，当一改此习。经此磨炼，飞鸟会将闻声而至，于是相伴此生。'),(93,'朝夕不相见，银河隔岸堤。筑桥当立断，启程披蓑衣。','2','遇水则搭桥，风雨无阻，求诸事当行其法，路途便得他人相助。桥通则运达，福气能从彼岸扑面吹来，或探寻前路，挖掘至宝。过桥若遇阴司鬼，默默前行便可无事。'),(94,'群山作围篱，夕暮可宿居。良人正远行，此夜莫越险。','2','路途遥远，怕生事端，此处群山环绕，幽静可居，便留宿一夜。贵人临门，言辞通畅，报福亦报平安，又小曲一二，悦耳动听。识此良人，不可多遇，当以礼待之，相伴同行。'),(95,'大海原上千千岛，钓舟出海告家人。','2','大海原上既有千岛，此去能成一番大业，却也颇耗时间。钓舟出海可先告亲友家人，日后衣锦还乡，众人亦能喜迎渔夫。海上常有异闻，深海千岛甚至四处宝藏，可谓迷人。'),(96,'朦朦胧胧，舟隐岛阴。明石铺路，天将见曙。','2','朦胧之间，岛屿藏木舟，幸得明石铺路，天空亦见曙光。夜中行舟需注意，浓雾之间不知有何物，近岛之后方得珍宝。更要提防海市蜃楼，将逢魔击破便平安无事。'),(97,'浪中无桦樱，深潜探不得。上岸观水面，倒影映似玉。','2','水中桦樱皆倒影，道理虽浅显易懂，行之却不易。为寻世上珍宝，人间多有荒唐事，静观其变，不必过早涉水。知倒影虽美，乃咒术幻化，需得本心，方见真实。'),(98,'行云飘无所，夜宿尚不定。浮华终觉浅，高离险峻峰。','2','自得清高者，虽四处飘荡，却知世间浮华不过如此。崇山峻岭中，深藏至宝无人知，唯有跨越高山者，可得寻觅。年华易逝，当下若无鬼怪烦扰，宜起身寻觅高山。'),(99,'飘蝶不知时，盛景为所迷。尘芥归于土，此身又成花。','2','梦蝶似梦非梦，常为眼前美景所迷，不知归路。然而花开终有时，尘芥归土又成花，如此循环往复，生生不息。不知身在何处，便可静听蝴蝶鼓声，随声而往。'),(100,'花非花本色，白露染极彩。此花见浓艳，牵牛咲朝颜。','2','得此签者喜上加喜，好事成双。花开虽有色，白露竟染彩缤纷，更彰显其艳。求一物，得赏远超所想。湿气可增白露，若是干燥难耐，色彩便无变幻。'),(101,'携笹丛林待时机，还愿其情能为知。','2','丛林寻神迹，若是心诚，又加志坚，此情此愿便能得保佑。只是林中境况尚未清晰，需步步谨慎，若有风声可原地静候。或邀友结伴同行，便无惧邪魔。'),(102,'风过水无痕，浪路迹未见。何时先已渡，彼岸是红花。','2','福运悄然而至，无声无息，无人知晓，如风过水，不见其痕。一切平安，无病无痛，笑口常开，风雨之后彼岸有红花盛开。若见红花遍地，可远观不可近赏，当谨记之。'),(103,'苗秀早晚各有别，晚莳之苗仍可恃。','2','大器晚成，却自在逍遥，放下功利之心，便得美梦成真，五福临门。若是栽种耕田，后起之秀需多加关心，切勿固步自封。耐心养育，无需揠苗助长，常有忍耐便能成事。'),(104,'大舟漂浮，荡漾不止。钓投浮子，忐忑诱鱼。','2','大舟虽壮观，水中亦有飘荡，浮子忐忑引鱼上钩，还需等待。海上难有万全之策，可放宽此心，谋事在人成事在天，荡漾之中必能满载而归。若有乌云压天，兴许海坊主出没，听其劝告多有得益。'),(105,'水源在何方，滔滔冲两岸。岩上生青松，百般仍有望。','2','若有气不畅，道不通，得此签能抵御晦气，重见天日。逆境生长更坚韧，水流激荡，青松挺立，莫愁万事空，却说岁岁皆平安。庭院中石路亦可打扫一番，增添运势。'),(106,'寄望于梦路，遥境照遥心。迷惑行漫漫，相逢在梦中。','2','梦中见仙境贵人，即便行路有所迷惑，此心得梦相照。有事不决，可交托此梦，求得寓意，梦中解惑，醒来之时便知天宫何如，此行何方。庭院窗台亦可放置风铃，得知此梦随风降临。'),(107,'都言鬼火心易冷，幽幽迎待久违人。','3','此签言明，万事将有转机。气不顺，则堵;心遇冷，则寒。终究有良人，通达情理，破冰开路，豁然开朗。只怕闭门造车，回避故友，前路又难明。白狼曾求得此签。'),(108,'三天晒网成泡影，一日捕鱼心莫急。','3','渔家何止一日三天，千锤万凿方有用武之地。此签有苦，却是苦尽甘来，能出人头地，扬名立万。诸事从长计议，事业、财富、姻缘、健康、出行，切勿心急。'),(109,'歧路众鬼意难定，好事多磨添耐心。','3','路中有百鬼夜行，热闹非凡可获良机，只是彷徨难定去处，熙熙攘攘当中难以驻足。山前有路怕山高，此刻凝神静气，须待时机，一念二想三停停，事方可成。'),(110,'混沌岩开金光照，不识此景非英雄。','3','贤德于陋室，金宝在深山，禾秆盖着珍珠亦难掩光芒，此签能迎伯乐。世间却有庸人，不识宝玉，不结良缘，何不绕道而行?萤草曾求得此签。'),(111,'寒天冰冻三尺余，暖日东风解其冰。','3','冰冻三尺，非一日之寒。缘来已久之事，此签可破，假以时日，托暖日东风相助，化其冰，解其源。若身体抱恙，近来也有好转，急于一时不可取。'),(112,'阴司饿鬼难满喫，人间顿顿有饱足。','3','怨满空腹，顿顿饱足是人间乐事，得此签可得丰收之年。只是酒莫贪杯，节制有益，嘴上油脂常擦擦，家中油烟宜清洁。传说饿鬼闻香气，偶有拜访中此签者。'),(113,'穷深山，孤芳常自赏。梅沾雪，一枝应长存。','3','得此签者，若心有烦事，可远离世间凡尘，静以修身俭以养德。便是周遭有险，亦能避凶趋吉，往来平安，饶是烦心却无所失。闻拟此签者雨中步行，滴水不沾，众鬼莫敢近。'),(114,'亲友出游，山麓成群。悠闲旅寝，别无执意。','3','得此签者，意得自在，游山玩水不亦乐乎，无忧烦亦无挂虑。宜出游，宜交友，又可修养身心，多多得益。常说旅人抽得此签，不论人潮汹涌或隐秘山林，皆可遇见好妖精怪，许以祝福。'),(115,'梅花香溢，芬芳入梦。其山阴暗，难隐春香。','3','此签光中有暗影，梅花香飘直入梦，好事临近，难以阻挡。只是此中有山，欲藏其芬芳，求得此签者可抖擞精神，破难关，得自在。若求姻缘，好事已近，当越过山路。有花香飘逸，可增添运势。'),(116,'三轮御诸岳，春霞蔽神山。霞奥遮春樱，幽然方盛开。','3','神山隐蔽，财不可外露，亦不可多言。欲气吞天下，排山倒海，见馨香之处，从内而发，自给自足。得此签者虽短时为春霞障眼，但终有一日见青山绿水，门路广大四通八达。'),(117,'浮云翳日无光照，樵夫宽眉手未停。','3','今日无光，浮云遮挡，虽不见那炽热，倒也安心乘凉，无需多苦工。林中樵夫虽宽心，手未停，饥者得食，劳者得息。求得此签可得财宝良缘，出人头地，避暑躲寒。'),(118,'百千丛群鸟，迎风自乐啼。一革新气象，老态是何人。','3','春风得意，有群鸟相伴，群乐齐鸣，有喜气冲天。但隐隐有忧患，处处非平坦，适当扫屋洗床被，除草清院庭，可避凶。此签传为扫地工所拟。'),(119,'花月相映，白如晴雪。暗香浮动，夜中可寻。','3','花月同如白雪，一片茫茫不可寻，唯有香气飘逸可识其花。所求之事难料结果，冥冥中有安排，识花者领人走出花丛迷宫。为居室添置芬芳气息，有助前途运程。'),(120,'净莲不染泥，朝露混玉珠。清新祛污浊，难辨几晶莹。','3','出淤泥不染，朝露堪比玉珠，此乃高洁之物。只是清新终须祛污浊，孤傲尽头是孤寂，还需谨记敞开胸怀，显其身手。当能扶摇直上，朝露成珠。庭院若有草木，可稍加修剪。'),(121,'一年一度，相晤计日。刑马作誓，莫过秋风。','3','既然许诺，近日必有应允之事降临，回头细想，便见端倪，饶是瘴气满目，一点即破。若曾对何人许诺，应有表现，莫等秋风过耳，食言而不自知。此时当沐浴更衣，口吐莲花。'),(122,'群雁搏羽飞，秋日数天明。今夜白云去，辉月更如此。','3','空中相争，与群雁搏羽，实在增长心智，百般锤炼。大风过后，此秋日天空晴朗，白云不挡辉月，贵人自来。至于试炼过后，若有所缺，此夜可愈，而后便是健康常伴，病痛全无。'),(123,'遥遥月挂上枝头，地上红叶映月辉。','3','红叶映月辉，地上得天回响，所求之事能有所成，且一事得一照应。若想寄情山水，宜当寻绝顶，高处不胜寒，却是美景胜收。切勿动手折枝头，使得月光落谷中，当远观勿要亵玩。'),(124,'橹声行船，高帆入港。画越天门，展翅大空。','3','行船游遍五湖四海，船帆高高驶入港，满载而归又平安富贵。稍作停留，便有大鸟展翅翱翔，空中越过天门，那是表决心志，一飞冲天。得此签者于事业多成就，也许云端高处不胜寒，苦情唯有自知。'),(125,'额上一片湿，露珠从天降。仙槎棹银河，星辰沾九天。','3','何缘一身不轻松，盗汗打湿衣襟，晶莹露珠从天而降，银河已改流向。不怕噩梦再烦扰，此刻清心泛天舟，可道星辰携好运，滋养生命感化怨鬼。得此签病得痊愈，前程有盼望。'),(126,'海藻一生如发髻，海神愿赐有心人。','3','有礼从海而来，海神相赠留珍贵，扬帆出海当有海风相助，耕种便得风调雨顺。诚心求问，神明赐下平安，发髻驱魔，若赠他人亦有福。但小心海浪急匆匆，吞噬万物不辨善恶，不分人畜。'),(127,'夜长梦多徒有名，相会天色已大亮。','3','秋风萧瑟，夜长便多有梦，不过有护身宝物驱魔，安然入睡神清气爽。求得此签命中有黑夜，所幸即将天明大有转运，所失有所得。光照大地，此刻不妨小憩，醒来自有新气象。'),(128,'旧宅三径，寥落无人。采撷福禄，犹自为君。','3','人出旧宅久未归，当下寥落惹尘埃，缘是为君采取福禄，荒凉中满是富贵平安。何人采撷兴许未知，常讨人喜悦不怕挡福神，避世难来转运。得此签可沐浴静心，平和待人，乘他人美意，结界中有所得益。'),(129,'阴阳雾中人不散，阎王扫雾见欢颜。','3','雾正浓时阴阳混沌，人不愿散去，终得所愿。此签需历多番磨炼，考验真心，往后得见有心人，得升官升禄，所求逐一有成。传此签鬼使黑生前所求，无人能解其惑。'),(130,'地棉无依靠，变为常青草。万物红渐起，独着秋绿衣。','3','无依无靠却顽强有力，万物着红之际，孤身独保绿。此签可见命中成就大事，破除万千困难，不以寻常教训为理，能建一番事业。多有孤军奋战时，切勿勉强，养精蓄锐，来日方长。'),(131,'神宫万色如仙乡，吴竹仙寿千代长。','3','神宫之上，仙乡之间，吴竹有仙寿，生长千代。此签明指长寿命，暗喻庭院见仙物，驱鬼挡霉保平安，即便命中有昏暗，仙竹能破此阴气。亦有传竹子长万年即化妖怪，谓之“万年竹”。'),(132,'轻罗长袖，灯笼流萤。袖里弱火，袖外光明。','3','上乘轻罗衣，如灯笼装流萤，便使小小火光，美如幻景。即便小小福气，也能积少成多，或藏衣袖，或装布袋，皆是人间难得好事。若带此萤火游四周，化身童子，岂不是更加妙哉?'),(133,'道入深山亦平凡，此峰遍览比叡巅。','3','深山多有险峰，亦传有妖怪潜伏，然而随道入此山，不过如此，平凡无奇。得此签必得深山坦路，一路到尽头，登上此峰绝顶，遍能览那比叡山巅。若遇得一白兔，胯下奇兽左右冲撞，无需惊惶，此乃人称山兔之妖。'),(134,'深山其中，零丁寻访。秋叶依土，遍山野红。','3','四处寻觅此深山，有所期盼，于是见得红叶美景，遍满深山。得此签者在此情此景前行，必多有收获，但道路恐多塞，此路不通便绕道而行。要知道路由心开，心安则道路通畅，无畏蜿蜒曲折。'),(135,'花开无缘见，慈父为女采。折花同赏玩，花开又见花。','3','任谁皆是贵人，此花即便无缘，亦得贵人相采，何况长辈亲人有作为。有路行不通，有事不可为，都可交托亲人好友同心协力，任凭本是相隔千里，亦能遂愿。虽有阴晴不定，却得温暖人间，闲时可与师父前辈同游。'),(136,'孤云缠绕万壑树，有人独伴白云眠。','3','万壑本险峻，树长万壑得天独厚，及至高耸入云比山更甚。此刻树旁唯有孤云飘，又有一人独相伴，即便优哉游哉，却独占鳌头，独享至尊。但需谨记，高山之下多白骨，莫要为了这一时胜利冲昏头脑，回神方知自己命中如此。'),(137,'秋色各不同，霜阳有疏密。春来再看花，此心总如一。','3','秋季花色总不同，此刻结霜，又见阳光，只有春色花开一片争艳，此心不常变。人与事变幻无常，得此签却将得一纯粹，无杂质，无多相，常随主人行。若是卧室居所物品繁多，当警醒留意，择良时合归一。'),(138,'积雪没车轮，铁栓锁木门。今日升空去，风雪少吹人。','3','车载何物往山走，不料天气恶劣，车轮没，木门锁，风雪吹。此签劝诫得签者，前路不明，危机四伏，宜当机立断，往回避凶煞。退路亦有勇当头，好汉不吃眼前亏，逞强无益事，不如回到庭院休整一番。'),(139,'柏叶一枝立，不知有神护。莫犯折枝手，望得平安临。','3','树木有灵，神护加身，庭院有树能保平安富贵，趋避邪气。运附身，便是纵横阴阳两界亦无所畏惧，人见人怕，鬼见鬼愁。但莫要用手亵渎神树，折枝运则离去，神明不听不应。'),(140,'山路多且艰，迢迢相难见。不识白山路，循迹到眼前。','3','何以跨越层层难关，又走迢迢千里路，有此心志必能成大器。但此去宜一改旧路，寻常平地难绕出怪山，必要寻觅那白云铺成之路，沿此路探寻到底。循迹到那山路尽头，或见奇妙光景。'),(141,'狩衣常年着，旧服留气息。沾香不识鸟，当换新皮袍。','3','陈旧之年，往事不可回首，既定之事，难以随心所欲。此签劝人莫常叹陈年，当下立此心志，鬼神亦相随，往那地毅然前行。传说何人求得此签后，竟烧毁于炉以表决意。'),(142,'岩上寒难眠，可否借苔衣。单袭两相难，共着是良计。','3','难眠此夜借青苔薄衣，单衣怎得两人穿，温暖非此衣，乃人心。若得贵人帮助，那是情义之举，若有困苦之人求援，当可行此善行。与伙伴度过危机，重见天日之时，绝处逢生便是春暖花开，运从天降。'),(143,'黄莺报人，蓬生荒居。春野若菜，露浸开怀。','3','好运到来，却有好事多磨，若菜从冰霜露水中生长，更加强盛有生机。此签在逆境中更显珍贵，犹如破冰利器，可助人无往不胜。有言道雀鸟逆风更好运，人亦如此。'),(144,'古川诚未闻，深渊变浅滩。世事千百变，遭逢不坠底。','3','所谓百年树人，时间洪流冲平万物，世间千百变化皆源于此。从前深渊今日浅滩，险阻不再，亦无惧坠底。若眼前所见如隔鸿沟，当静心等候，一切交由光阴定。'),(145,'错音泯然，琴声入扣。庸人难扰，相逢喜事。','3','在外遭遇困难事，回到寮中，有琴声丝丝入扣，有喜事相告主人。事可求，情不可求，人间温暖岂不胜那冰冷景色，良缘得天赐。又言，世间耻笑妖琴师，抚琴却使人安眠，何人能识此等好事。'),(146,'山陵崩裂，此身为石。天女衣顾，千岁抚兮。','3','山崩石分离，却得天女顾，得此签者命中将有人生转折之时，天赐良机。崩裂乃是危险事，常言富贵险中求，人若过桥，能得同伴随此生。若得良缘，应当珍惜，莫说此石顽固，天女亦弃之。'),(147,'山风谓之岚，风吹野边里。草木为所折，摇曳残将枯。','3','山风吹拂有劲道，旷野之中，草木折腰，残枝落败，纵是谷中岩石亦能劈开。不仅前途无量，道中清除杂物，使得大道通畅造福后人。要知此劲能助人，亦能伤人，行事多注意，莫刮可怜人。'),(148,'西风拂日光，音羽山飒飒。风刃削山岭，峰上叶渐红。','3','邪魔恶鬼需利刃挫其锐气，西风曾沾日光，又在山中飒飒作响，必能断此妖邪。只是利刃刀口需小心，便是山中与敌争，削去山岭事可削，木叶竟也渐见红。阴阳术中守护之阵，当娴熟运用，以防刀剑无眼伤人心。'),(149,'素色唯一沾白露，何以染红千万枝。','3','本只沾白色，却能染红千万枝，福运润泽四方，周遭多逢喜乐。登台能唱遍天下，行走能名满四方，路上行人，莫不受其感染，由衷赞叹。此心若不改其志，方有心想事成，兼济天下。'),(150,'山边望清爽，举头对秋月。愚人不识路，归去照足前。','3','此山风景好，明月亦清照，于是流连忘返，归去之路暗中难寻。得此签便有明月引路，不但恶鬼莫敢近，更有福星随月到，道路平安且顺利。此月何以有灵，传说辉夜姬之相识也。'),(151,'稻穗实未结，农夫守山田。收成归家后，稻谷食三年。','3','好事恒久需等待，稻穗将熟未结，耕种之人还需守护，片刻不可离。时运到来，便是开满此山，收成归家更能供粮三年。还需谨记，仓库宜锁不宜开，防盗更防鼠。'),(152,'锦丝织绫罗，披肩惹人羡。皎月当空照，水映好景常。','3','锦绣绫罗遇此良辰美景，富贵人家再有福运相随，大喜之兆，普天同庆。羡煞旁人时，可谓相逢无敌手，随心所欲能成就美事。若是闹市显眼，怕引闲等之辈，可在青山绿水之间常行。'),(153,'降雪不长久，激流增雪溶。险峻足引山，濑音此更增。','3','前路虽有困难险阻，却不知此时春日已到，寒冰已破，高峰亦不足为惧。得此签前路开阔，高榜提名，学有所成，一帆风顺，左右逢源。山路行走多加留心，若是风黑月高不宜冒险。'),(154,'雪降银一面，草木犹似华。严寒盖天地，白花咲容颜。','3','寒冷中银色一片，天地无杂质，花开着白衣，乃是人间美景。雪地之中有白花坚立，可见毅力非同寻常，便是有因有果，终得回报。若得银狐灵兽，当为人中龙凤，福如东海。'),(155,'远去求缘讯杳然，踏雪入山车痕深。','3','求问当即未得果，应当静心等候，待到有车远出来，雪地之中车痕深，乃满载而归。所托之人绝非背信弃义，驾车归来必定成就主人。山中若有雪之妖，当立即清除，以免风雪挡前程。'),(156,'岁寒雪降漫苍天，后知长青叶坚挺。','3','天寒地冻最能知其松柏，长青之叶何惧此等微风。命中有降雪挡路，惊险不过一时，云开之后万里前程，一路平川。非同寻常之人更当心平气静，勿忘初衷，方知春暖何如。'),(157,'飞鸟渡川，疾流奔涌。不舍昼夜，驰赶天星。','3','世间常有人欲追赶天命，望得天星，犹如飞鸟奔流，勇猛前行。若能伸手触碰流星，必当得上天眷顾，邪鬼难近其身。只是不分昼夜一路狂奔，还当注意多多保重。'),(158,'细石成巨岩，生苔不止息。一杯长寿酒，年华岁常青。','3','生生不息，延绵不断，积少成多，自力更生。世事虽无常，因果应犹在，若盼有朝能得胜，定当行之有法，取之有道。可于庭院泯一口清酒，暖身亦能健体。'),(159,'观花宿庭院，时逢春日临。折枝贴髻首，一咲百花开。','3','居此庭院待花开，春日临时，有人为君摘得此花，贴于髻首。百花随之开放，百事随之通畅，得前程大运时，莫忘摘花之人。庭院常备木席，若兴致盎然，便可静赏百花。'),(160,'山间旭日出，照览阴暗池。天下无云雾，幽魂惧雄威。','3','阴暗之地常有鬼怪横行，山间迎来旭日，良机已到，陈旧之事当作整理。有神威相助，无惧难缠之事，小小幽魂，无伤大雅。常有人为求晴朗，将日和坊挂于窗前，家宅便无阴鬼。'),(161,'不决去向，留或不止。樱花代定，盼指清泉。','3','踌躇不决，满心疑惑，即便求问神明，兼听四方，亦不知所措。此时路上应有樱花一枝，可代指清泉，不管前路通往何处，必得解渴活源。不知何人行此事，非神亦非妖，奇哉妙哉。'),(162,'比叡山风急吹雪，万絮纷飞伴君足。','3','万絮纷飞，美景常绕此山行，若有意越此山，必得同伴总相随。凌乱之中，道路不明，行差踏错不可避，贵人从旁指点，便相安无事，大步向前。风雪之中，亦有人见两妖路过，不知何人差遣。'),(163,'都鸟来去与香问，留置游子何时归。','3','游子虽身在远方，若是归去，鸟语花香当伴其身。常回庭院，不仅风景如常，更有都鸟送来福运，却比旁人轻松。不论何时归来，总有一人守候此处。'),(164,'袖裹飘飘可扱玉，冀移无主令观玩。','3','有此好玉无人识，即便当下只有袖裹飘飘，亦可收入囊中。世人常有不识宝，得此签者有慧眼，可辨别万物，鉴其本相。若逢知音亦可分享，喜事当告之天下。'),(165,'今朝始见蔷薇色，奇花多姿展笑颜。','3','蔷薇艳红，今朝得一见，只是观其姿态，便笑逐颜开。好运随花开而临，切勿伸手亵玩，远远欣赏最为妙。若是按捺不住喜悦之情，可邀亲友同赏花，岂不乐乎?'),(166,'郭公翱翔峰上云，彼声高鸣影不见。','3','郭公虽小，翱翔云中竟如大鹏，高鸣能闻其声，却不见其影。得此签前途亦然，鸿鹄之志得天应允，飞越万里不过瞬息之间。空中或见鸟形之妖，若是无害便可结缘。'),(167,'空蝉留骸，脱壳木上。魂去不知，当游此世。','3','得此签近日将脱胎换骨，施展抱负，诸事进入正轨。旧壳已褪去，陈旧之事不可过分追恋，当以前途为重，目光专注前方。游魂太远，恐怕落入迷途，可为诸事作一标识，以便日后回望。'),(168,'唐池波音，今非昔日。浪改春调，律拍岸响。','3','风云有变化，今时往日不可相比，转运之时将至，困苦得以消散。跌宕起伏时，可顺势而为，顺应天命，便福运绵绵，衣食无忧。浪花有变，渔夫曾见鲸鱼之女于浅滩之处。'),(169,'来雁不失途，春霞存墨流。云路知天处，归去赏世间。','3','若是展翅腾飞，大雁不必担心路在何方，即便霞光相隔，亦有明路指引。在这遥远路途，前途通达，又有世间美景相伴，夫复何求。若有飞鸟落庭院，枝头果实可解其渴，福鸟宜善待。'),(170,'苇边群鹤乱鸣叫，夕暮鱼塘渐有鳞。','3','群鹤鸣叫欲求食，夕暮池鱼游至此，喜上眉梢。得此签者五谷丰登，盈车嘉穗，穷乏者得肉满盆，酒溢杯。此鱼又是猫最爱，或引来一二小猫。'),(171,'枯木逢春遇贵客，溪流漫漫禄自行。','4','良久未见好事，似是风平浪静，实则贵人缓缓而至。求得此签，顺其自然收获意外之财，只是财运深藏，不可见其面，不知其形，未闻有声。出游、远行、探访一帆风顺且出入平安，又有谋职、搬迁可为。'),(172,'此情此景当叫好，结伴重游更欢愉。','4','此刻情真意切，便是人间美景。可世人常为美景忽视盛情，不知情为何物教人相许。若想留住景色与佳人，当要有所行动，若止步不前便是一场空。源博雅曾求得此签。'),(173,'绿苗新田间，悠悠初长成。稻叶长作浪，秋风收成时。','4','今日种下因，明日未得果，由因到果，需时日以待。收成之日不躲藏，可有饱足得享乐，中此签者劳有所得，喜迎丰年。稻叶长作浪，所得超乎所想，可整理仓库以备不时之需。'),(174,'归雁翱翔，白云开路。传书鸣叫，遍游五湖。','4','大雁飞来，鸣声四传，不日将名扬天下，得贵人开路。但也需留心此名何为，若是美名无妨，当守心自省，使人常见。也可于庭院窗前挂彩带风铃，好指明大雁归路。'),(175,'樱花告春临，迟暮盛景见。告春也樱花，恒久无谢时。','4','春与樱花，相伴相生，一前一后，迟暮仍得盛景。求得此签，福之将至，前后各得一着，满载而归。又一说美景一刻便是永恒，若将窗前整顿一番，可富贵常在，好运常来。'),(176,'落叶埋庭近闲居，松虫不知地藏金。','4','闲居无人清尘埃，落叶埋地深三尺，何以无人于此处，掘地便识地藏金。前路开通，财运渐显露，此金从地长，源源不断如清泉。若将居室整顿一番，兴许寻得意外之财。'),(177,'何人拾得玉梓书，可闻秋日有高啼。','4','此运路中行，何人拾得便有福，不择其主，不辨何人。便是秋高气爽，落叶枯黄，亦能得幸转运，化作鸟儿向天高飞。将路铺平视野开阔，修剪枝叶顺风顺水。'),(178,'贵人指点相得见，渔舟轻唱竹告之。','4','得此签者问何事，何事有应答。便是在河上吟唱，渔舟能得竹林相告，何况只是平底询问，贵人当来指点。可备三五茶点，与贵人亲友秉烛长谈，前路渐明。'),(179,'夜月摇摇便西沉，秋山风吹来涂归。','4','所遇喜事意正浓，不识来途亦可归，此番归去，半夜月色逐渐西沉，秋日山中有风迎送。借此山风则诸事顺利，无病无灾，山下众生得知，好生羡慕。要小心欲念惹山妖，谨慎行事，切勿妄为。'),(180,'柔枝飘飘，柳色更新。春光融融，妙不可言。','4','容光焕发，光彩照人，近日开心之事多发生，奇妙之处细细品味难与人言。纳新吐故，除旧布新，气贯长虹，人人可见喜气满溢。清除一番污秽旧物，装点一新，留此好运。'),(181,'文华头尾须得见，禾刀当遇正道中。','4','荣华富贵须见头尾，禾刀也需用在正途，得润泽者行可行之事。小指末节时常阴差阳错，无碍大局，最怕落石悬崖，道中见惊弓之鸟。得此签可端正己心，诸道可行。'),(182,'天河瀑布撞石落，溅花仰头映月明。','4','瀑布从天而降，所求之事必能声势浩大有着落，所溅水花与明月相照，鉴明此心何为。碰撞方有水花，遇事不必太惊惶，酒杯交碰，此音悦耳。三千尺银河，其中多有珍宝妖怪，明察便可见。'),(183,'空谷回音来，逐水如轻鸟。哀声已消绝，可赏晚霞艳。','4','不论求何事，逐何物，此签可得回应，无需过分担忧。先前何故常哀鸣，今日已绝于耳，一片宫商相伴，晚霞升起竟如此美艳。赏此美景可邀良朋亲友，一同分享此刻喜悦。'),(184,'春山疾风花乱舞。雪飘凌乱见佳人。','4','春雪飘飘，疾风催花空中起舞，凌乱之中缘有贵人在此处，方能赏奇景。不日或有奇妙事，见得贵人莫搪塞，本非麻烦，还当迎客入室。一说此风天狗所为，真假不明。'),(185,'长青常磐山，倾听风飕音。闻声识神明，知是福何来。','4','人有五感皆能知福，虽在山中，不见其形，若能闻风飕飕音，便知福运将至。常磐山上见神明，清心静养更相宜，潜心修行，心目更明亮。若要长久离家，当闭户锁窗，待福运临门，方迎客入内。'),(186,'晨曦曙光色多变，七色辉耀绘千卷。','4','晨曦普照大地，雾中曙光多有变化，其中分化七色，照耀千卷美如画。所得好运从四方而来，出入平安，诸事可为，阴邪之气尽皆退散。千卷当中有一卷，花鸟相映成趣，成一奇迹。'),(187,'雪花散去空自落，彼端枝头春满开。','4','此地雪花随风飘散，尽管冬未了，风吹彼端便是春日花满开。所求之事，寄托明日远方，无需急一时，脚下留心莫踩空。冬去春来，不仅落雪，更有花瓣，当打扫庭院迎风来。'),(188,'樱花缤纷散空中，云交落地掩泥路。','4','泥路多难行，空中樱花与云相交，竟可落地护行人。不知何物有灵气，知人之困苦，遂将此身助人渡劫，享得安乐。传说此乃樱花妖所为，云上何人亦相助。'),(189,'盘根其上似云居，高耸连天心意至。','4','盘根成云居，此乃奇观，奇观之上，欲将心意传达天际，此乃奇人。若有志如此，便是摘得天宫又有何难，居住云端，家业繁盛，出类拔萃。只是天宫常寒，宜添置被单床褥，莫要感染风寒。'),(190,'小夜将曙明，秋日山风劲。吹返至中天，月挂川竹上。','4','天明将至，月当沉下，不料此风将月吹返至空中，震惊世人。得此签行事如若山风，劲道十足，金石为开，得偿所愿。风神显形，亦有此奇观。'),(191,'都鸟啼叫都城事，已知佳人何处归。','5','都鸟难觅见，属稀罕之物，鸟啼都城事，更知所想之人归来。此签为大吉，先前等待之事有着落，许久未见之人可相见。求财寻物问健康，通通可行。运程之好，亦可为他人报喜，助人为乐。都鸟来临，庭院有一番美景。'),(192,'乍看春樱乍现，今朝所盼今迁。','5','所谓鸿运当头，便是此签。抬头即有良辰美景，心想即能事成。只是随心所欲后，又怕乐极生悲，不妨专心享受，明日之事明日愁，不必抢先。闲时四处转转，兴许又有惊喜发生，好事成双成对。'),(193,'藤开犹紫浪，遍满户庭间。浪涌魅人近，宿前久驻留。','5','藤开满户庭，一片紫色如浪，福运攀藤而上，及至家门。当入睡之时，却为奇景惊叹，此物虽为人所种，却由天成。正是谋事在人，成事于天。一说紫藤为妖怪所化，为要传富贵之气。'),(194,'公道忠义在人心，苍苍翠柏禄马停。','5','遇事有公道，遇人得忠义，万事可行，四方得利。在青葱翠柏之间游乐，却见禄马停一旁，意外之财从天而降，喜上加喜。但人在山路行，还需注意各路安全，小心为重。'),(195,'家业华禄达宝城，云中好箭得贵人。','5','此城为宝城，家业昌盛，得美誉财宝，一世功名。在云中空射箭有猎物，贵人亦在旁相助，平安有成就。可收拾家中器具，以待宾客，迎好运之人。'),(196,'谷中福草永无断，万物灵气意相连。','5','谷里有福草，难求显珍贵，此处福草永无断，福运自然不消减。万物有灵气，得此签有上好人缘，甚至得有灵之物相助，富贵无边。当与灵物意相通，迎客入内，羡煞旁人。'),(197,'青鸟发啼声，芝书新振耳。苦待终成功，得享旧年盼。','5','十年磨一剑，今日终得名。得此签者复光明，功成名就临此门。皇天不负有心人，多年等待才有青鸟捎带芝书，年年所盼可见其心。既吐气扬眉，可添置新衣新鞋，改头换面迎喜气。'),(198,'庭前福至，种千寻竹。家门冬夏，得灵庇护。','5','顺心顺意，祛病挡灾，家宅平安，恶灵退散。福气临门，庭院竹子能长千尺，尽管冬夏轮回，庇护灵未曾随节气有变。若有闲心，可养一二草木，有助好事成双。'),(199,'此院恰如盐灶中，晨风自来泊此湾。','5','后院好景如旧日盛况，即便晨风也径自吹来，留泊此湾。得此签者自有香气飘于人间，不仅福禄，便是才德亦能服人。何不开门迎客，摆设佳肴招待亲友，多多益善名满人间。'),(200,'游龙亲临泽，河水染红叶。至今未曾闻，水中见浅影。','5','龙乃祥瑞，见天上游龙亲临泽，河水定非泛泛之辈。红叶遍染此河水，水中亦见龙浅影，天降大任于此水，求得此签兼济天下。若有红叶相伴，得美景闲情，游龙亦将长留此地。'),(201,'青阳绿意得生机，本非霞气登天际。','5','青青绿草阳光普照，一片生机盎然，即便非紫霞亦能顺其登天。得此签近日好事频频，全身精力满满，无惧挑战危机，得上天眷顾，万物相助。当知春去秋来，节气轮转，世间常无永恒。'),(202,'飘摇青柳丝，寄身春风里。狂风安然度，微风不折腰。','5','青柳丝乃至柔至轻，在风中摇摆，既不折腰也不遇险，安然度日。此签保人平安，任那窗外是非多，必难入此屋，消灾吉祥无需多求。若能为宅居增添一两青绿，更是怡人，又能添运。'),(203,'几朝年老翁，策杖花仙境。庭院除杂草，来宾香更胜。','5','宝地已是难得，更有贵人远来，此番赏花当能喜上加喜。好事成双，不仅成就事，便也能成就人。听贵人良言，才德兼备，方为人中龙凤。但庭院若有杂草，恐防有碍花飘香，当尽早除去。'),(204,'除旧迎新石中宝，云外枯木逢春开。','5','石中宝物终见天日，除去旧虫蚁，迎此新气象，枯木云外亦盛开，奇迹景色接连不断。常年愿望得实现，未明之事见开朗，运从天降，福星高照。得此签者平步青云，但切勿行差踏错，失足千古恨。'),(205,'久方云天宫殿间，何物美如天上星。','5','天上星辰挂宫中，珍藏宝物得享福，天宫更有贵人在，邀约游戏此人间。财运福运伸手可摘，仙果生长到门前，若把自宅当作天宫，星辰便在家中。鸿运当头，或许得见那稻荷神明，一矢中的。'),(206,'川间育金石，顺水长漫步。天神忽降迹，欲睹此金石。','5','河中有金石，不知何处生，神明竟也想一睹风采，可见此乃奇石。此石顺水行到门前，当拾取放置庭院，醉翁之意不在酒，乃求神人从天降。若有神明敲门而至，以石换此缘，岂不妙哉。'),(207,'岁末年将至，此龄亦增老。疾流不回首，酿酒亦更香。','5','时光催人老，光阴不等人，行乐需及时，往后遇事明白人。经历一番天长地久，知事何成，知人真心，酒香四溢方为极品。若得美酒，可与挚友畅饮，曾有妖怪因此成就一番美事。'),(208,'神灵作御杖，精雕木与银。神气蕴其间，千里得轻越。','5','所谓神之御杖，虽有精木银雕，神力却不在于形，而在其灵。万事借壳难突破，唯有心随神灵走，千里之路无需劳苦，一瞬之间得安全。持杖之人可深交，结伴同行福禄临。'),(209,'翘首望东天，遥望久方月。奈良春日时，三笠皎月同。','5','东方有月，虽是远洋之物，却与三笠山上皎月同。深情可达人心，立志便能事成，皎月乃是好寓意，若有所求当前行。月虽相同，却不知辉夜姬所居何处。'),(210,'闲居山畔眺白云，昂首知我作何为。','5','不仅山畔此居有闲情，白云漂浮，昂首便知挡日光。福神降临，天地万物为己所用，意气风发，鹏程万里。在这好时光中，若是出门寻觅，或遇奇观神兽。');
