INSERT INTO `lucky_thing` VALUES (1,'爬起源之塔','24层又卡BGM了','爬起源之塔','喜提4级克制之戒'),(2,'打BOSS','进门贴脸电，丝血掉线','打BOSS','一道闪光出现，那是。。。神秘！'),(3,'强化上星','哭脸.jpg 那啥+1(6x痕迹)','强化上星','表演一手1W星星点2件15的魔术戏法'),(4,'洗潜能','几百发魔方都上不了ss','洗潜能','你们可能不知道只用3个黑魔方从A-SS是什么概念'),(5,'砸专属','第一发就给我炸了？？','砸专属','你今天要是能一专属把我装备炸了，我当场...(自行脑补)'),(6,'咕咕','咕咕咕','咕咕','咕咕咕'),(7,'开车带萌新','上车吧我贼稳。(打到一半)我游戏没了。','开车带萌新','萌新对你的好感度+1，以后你就是大哥了！'),(8,'打怪冲级','吃药秒掉线，上线图没了','打怪冲级','升级气象不断，到哪都是满燃烧'),(9,'随皇家','这期皇家这么毒的吗','随皇家','1发就出了？我买了一组！！'),(10,'晒截图','喜提套餐x30天，而且管理还忘了解封了','晒截图','引来了群友们羡慕的目光！'),(11,'肝活动','这活动是人玩的吗？？','肝活动','这活动怎么这么简单啊'),(12,'充钱','服务器故障，钱没了，点券没到。','充钱','会引起数龙的注意，特地给你提高爆率！'),(13,'洗内潜','把使用在运气上的点投资了2%到敏捷','洗内潜','攻速，38buff，20暴击！'),(14,'开闪耀','十发盒子，九件是重复的','开闪耀','一发盒子，对！我就想要这个！'),(15,'爬塔','今天的小怪怎么打不死啊？','爬塔','今天的小怪怎么不打音乐盒啊？'),(16,'当复读机','当复读机','当复读机','当复读机'),(17,'睡觉','不准睡！今天25小时冒冒加班！','睡觉','快睡吧，22星、1299、神秘，今天的梦里什么都有'),(18,'站街聊天','半小时被扣7点人气，招谁惹谁了！','站街聊天','吸引到了路过的小姐姐，喜结良缘！');
