  `exp` varchar(255) DEFAULT NULL,
  `fs` varchar(255) DEFAULT NULL,
  `level` varchar(255) DEFAULT NULL,
  `ma_damage` varchar(255) DEFAULT NULL,
  `max_hp` varchar(255) DEFAULT NULL,
  `max_mp` varchar(255) DEFAULT NULL,
  `md_rate` varchar(255) DEFAULT NULL,
  `mob_id` varchar(255) DEFAULT NULL,
  `mob_type` varchar(255) DEFAULT NULL,
  `pa_damage` varchar(255) DEFAULT NULL,
  `pd_rate` varchar(255) DEFAULT NULL,
  `pushed` varchar(255) DEFAULT NULL,
  `speed` varchar(255) DEFAULT NULL,
  `summer_type` varchar(255) DEFAULT NULL,
  `boss` varchar(255) DEFAULT NULL,
  `link` varchar(255) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=9187 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;
