INSERT INTO `msg` VALUES (104,'三核就是完全体的贝勒德，在不打掉它的几个核，直接进入头部打，就是打三核。会掉大量的绿色贝勒德币、小概率掉落中高级贝勒德吊坠、腰带。一般需要210级，100万以上面板才能单挑。\r\n\r\n三核贝勒德，等级：200/210，血量：850E（250+300+300），防御：80%，有x50%减伤，弱点属性：无，贡献：？，获得领导力：？，经验量：0。','三核','123179118',NULL),(105,'贝勒德每天可以通关一次，由司机把贝勒德的P3血量揍到剩下几毫米，退组留下乘客独自打完剩余血量的通的行为则为补刀。补刀不占用司机的通关次数，所得的奖励由乘客全部获得，要求最低等级为200级。          补刀前乘客须在心脏门口等待司机削弱贝勒德血量，待头顶出现红色倒数条时进门清理地上的小怪，司机退出地图后消灭贝勒德即可。新版贝勒德无法补刀　- 抄自Loli','补刀','123179118',NULL),(106,'找我老婆干什么','LCD','123179118',NULL),(110,'[CQ:image,file=img/lianji.jpg] 20-50可以通过鱼包升级','升级','123179118',NULL),(114,'核心宝石 V矩阵\r 完成第五次转职的角色将开启全新的技能面板V矩阵。在神秘河所有区域狩猎怪物将有概率掉落核心宝石，掉落率大约在1000只怪/颗。完成消亡旅途的周常任务也会获得3颗核心宝石。\r \r 开启核心宝石获取随机核心，同名核心可相互强化。强化经验量已经列在群文件中。\r \r 200级的V矩阵初始只有4个核心槽位，每升5级就会额外开放1个核心槽，可以通过花费金币提前开启核心槽。\r \r 200级之后每升一级都能获得1矩阵点，可以用于强化V矩阵的矩阵槽，最高强化至5级，每强化一点矩阵槽，在该槽上的核心就可无视等级上限向上提升技能等级。','矩阵','123179118',NULL),(118,'双倍魔方打折活动。\r\n在活动期间内，使用魔方升级潜能的概率增加。且有可能一次跳2级！\r\n每年春节和周年庆基本都会有一次双倍魔方活动。','双倍魔方','123179118',NULL),(123,'[CQ:image,file=save/F5961A2A1AE741C4912CB17CBB3DE04A]','菜谱','123179118',NULL),(132,'朱丽埃塔，需完成莫奈德任务线，每天3+1次，通过莫奈德成就板可以领取第四次入场卷，击杀可以获得怪异魔方。血量126E','章鱼','123179118',NULL),(133,'朱丽埃塔，需完成莫奈德任务线，每天3+1次，通过莫奈德成就板可以领取第四次入场卷，击杀可以获得怪异魔方。血量126E','八爪鱼','123179118',NULL),(134,'朱丽埃塔，需完成莫奈德任务线，每天3+1次，通过莫奈德成就板可以领取第四次入场卷，击杀可以获得怪异魔方。血量126E','朱丽埃塔','123179118',NULL),(148,'[CQ:image,file=img/neizai.jpg]','内在','123179118',NULL),(150,'[CQ:image,file=img/ngs.png]','ngs','123179118',NULL),(151,'[CQ:image,file=img/lankuang.jpg]','蓝框','123179118',NULL),(154,'MVP气象(MVP Atmospheric EXP Buff)\r\n\r\n当玩家在游戏中消费点券到一定数额后，将获得不同的MVP等级。并可根据等级在商城中领取每日奖励及每月奖励。\r\n\r\nMVP黄金及以上的玩家将有概率在每日奖励中抽到MVP气象Buff。使用瞬间，与施放者处于同一地图的所有角色都将收到30分钟的1.5倍经验增益。\r\n\r\n刷怪升级时可留意大喇叭。\r\n形如: 59分20X匠人气象\r\n意为 将在20频道，接下来的第一个59分于匠人街使用MVP气象Buff，希望大家跑去捧个场。\r\n\r\n如果喇叭中没有提及地点，则默认为匠人街。','气象','123179118',NULL),(156,'九歌官方gay。','捷哥','123179118',NULL),(164,'光谱，俗称推球，无名村日常之一。第一关杀怪获得艾尔达，到一定点数可以在中间设备按采集，进入推球模式。攻击设备生成光球，按空格将球往两边光柱推，同颜色加1点数，紫色球两边都行，并且加2，满10点后进入第二关。\r 第二关有两种，一种类似次元入侵，怪物数不能多于五十个，中间设备按采集可以全图清。\r 另一种是推虫子，站在中间设备长按采集可以将两边的大虫子往洞穴推，成功上面有文字提示，推满5次算过关。','推球','123179118',NULL),(166,'[CQ:image,file=hj/RED.png]','RED','123179118',NULL),(167,'[CQ:image,file=hj/V5.png]','V5','123179118',NULL),(168,'[CQ:image,file=hj/超越.png]','超越','123179118',NULL),(169,'[CQ:image,file=hj/传说.png]','传说','123179118',NULL),(170,'[CQ:image,file=hj/顶级.jpg]此卡没有整容','顶级','123179118',NULL),(171,'[CQ:image,file=hj/经典.png]','经典','123179118',NULL),(172,'[CQ:image,file=hj/俱乐部1.png][CQ:image,file=hj/俱乐部2.png]','俱乐部','123179118',NULL),(174,'[CQ:image,file=hj/龙脉.png]','龙脉','123179118',NULL),(175,'[CQ:image,file=hj/摩卡.png]','摩卡','123179118',NULL),(176,'[CQ:image,file=hj/奇迹.png]','奇迹','123179118',NULL),(178,'[CQ:image,file=hj/水晶.png]','水晶','123179118',NULL),(179,'[CQ:image,file=hj/伪娘.png]','伪娘','123179118',NULL),(180,'[CQ:image,file=hj/伊利温.png]','伊利温','123179118',NULL),(182,'[CQ:image,file=hj/周年庆.png]','周年庆','123179118',NULL),(201,'大金鱼召唤包，钓鱼副产物，常用于小号20-50级升级。\r\n用法：找一个斗燃100的图，大号放鱼包，小号吃双打鱼升级。','鱼包','123179118',NULL),(210,'[CQ:image,file=save/2B2B0FC022702915E6A8765CD9D20712.jpg]','强混','123179118',NULL),(214,'[CQ:image,file=save/335EF45E0D7B0DCF708FA050CB64F8AE.jpg]像素周年版本后，烧树上坟的孤儿任务已简化，所有任务耗时都差不多，但还是尽量避免天际线相关任务。','避风港','123179118',NULL),(215,'[CQ:image,file=save/4F337741B10DE582B0387AEC0FC975B9.png]','ling','123179118',NULL),(219,'[CQ:image,file=save/C78C01F644092EAC808D5A678718F6C7.jpg]','碎梦','123179118',NULL),(223,'觉醒希拉，入场250，boss等级255，血量176T，神秘要求900，BOSS分4个阶段，每打掉25%血转阶段','希拉','123179118',NULL),(227,'[CQ:image,file=save/20EC3BE050A4C6006E50828C6FCF9133.jpg]','宝珠','123179118',NULL),(230,'[CQ:image,file=save/B14C231101A7885F4694F1CD9847D751.jpg]','拖德 ','123179118',NULL),(231,'[CQ:image,file=save/B14C231101A7885F4694F1CD9847D751.jpg]','托德','123179118',NULL),(232,'托德系统的作用就是将低等级的装备的潜能、附加潜能、星星（托德过去之后会降一）托德给高等级的装备。\r\n\r\n1.装备必须有至少一星才能去作为拖德材料，因为之后会降一星。\r\n2.装备必须砸完卷（即消耗完升级次数）才能上星。\r\n3.同类型装备才能拖得，但套服可拖上下衣，上下衣可拖套服。与职业无关，海盗帽子可拖法师帽子\r\n4.星之力加成动态调整，纯白先拉后拉没影响，但不能留升级次数。\r\n5.使用托德系统时，要求托德材料及被托德装备之间等级不能超过10级