INSERT INTO `quiz_oz_question` VALUES (393,'What is the name of the broker residing in Magatia?'),(394,'What is the name of the buddy list admin in Lith Harbor?'),(395,'What is the name of the buddy list admin in Ludibrium?'),(396,'What is the name of the dog sitting next to the Dimensional Mirror in Orbis?'),(397,'What is the name of the current council president in Edelstein?'),(398,'What is the name of the former council president in Edelstein?'),(399,'What is the name of the grandma guarding the Great Temple in Pantheon?'),(400,'What is the name of the helmsman of Riena Strait Glacial Observatory?'),(401,'What is the name of the Humanoid residing in Magatia?'),(402,'What is the name of the kid monk in front of the Golden Temple entrance?'),(403,'What is the name of the merchant on the Nautilus?'),(404,'What is the name of the pet master in Ellinia?'),(405,'What is the name of the plastic surgeon in Ariant?'),(406,'What is the name of the skin care expert in Ariant?'),(407,'What is the name of the storage keeper in Ludibrium?'),(408,'What is the name of the storage keeper in Rien?'),(409,'What is the name of the storage keeper on the Nautilus?'),(410,'What is the name of the streetsweeper in Edelstein?'),(411,'What is the name of the town mascot of Edelstein?'),(412,'What is the name of the upcoming merchant in Pantheon?'),(413,'What is the name of the warp helper in Herb Town?'),(414,'What is the name of the weapon merchant in Ariant?'),(415,'What is the name of the weapon Seller on the Nautilus?'),(416,'Who in Kerning City can repair items?'),(417,'Who is the item creator in front of the Sleepywood Hotel?'),(418,'Who is the merchant in the Golden Temple?'),(419,'Who is the merchant in Gold Beach Resort?'),(420,'Who is the warrior job instructor in the Warriors\' Sanctuary?'),(421,'Who is the weapon seller in Perion?'),(422,'Who is the subway worker next to the Ticket Gate in Kerning City?'),(423,'Are you asking me if I can see in front of me? Of course I can!'),(424,'Do you want to learn how to achieve spiritual enlightenment?'),(425,'Grendel the Really Old is not a bad person, but his students...'),(426,'If you have the Scroll of Secrets, give it to me!'),(427,'I can only do this by myself for so long...'),(428,'I can\'t wait for these kits to grow up!'),(429,'I found him, so I\'ll take care of him!'),(430,'I gotta say, I look pretty good in an apron.'),(431,'I need more firewood for the furnace.'),(432,'I need to send these herbs to Tae Sang fast...'),(433,'I serve the ancient Nova deities.'),(434,'I will never let go of thieves who try to steal from me.'),(435,'I\'m worried that monsters these days are much more ferocious...'),(436,'Just look at me! So strong. Don\'t be jealous.'),(437,'Life is transitory. As time passes, the world will change.'),(438,'My friend Arwen is still pretty uncomfortable around humans.'),(439,'My hands aren\'t what they used to be. I really need to get me an apprentice...'),(440,'Nice weather, isn\'t it? It\'s a greay day to enjoy a walk with my pet, Muffins.'),(441,'Nothing like a good set of Pirate digs, mates!'),(442,'Outsiders can never be trusted.'),(443,'Pirates are the best!'),(444,'So much homework... And so much studying to do... Man, I\'m swamped.'),(445,'That smell in the air sure does make the fur stand up, don\'t it?'),(446,'The seas have grown fat as an orca, eh?'),(447,'This room is not open to the public.'),(448,'We must work together.'),(449,'Where are all my research notes? And my fairy comics?'),(450,'Won\'t somebody bring me some food? I\'m starving?'),(451,'Work is important, but eating is crucial!'),(452,'Which of these bosses has NEVER appeared in MapleStory?'),(453,'Which of these chairs does NOT exist in MapleStory?'),(454,'Which of these cities does NOT exist in MapleStory?'),(455,'Which of these is NOT a crafting item in MapleStory?'),(456,'Which of these is NOT a one-handed weapon?'),(457,'Which of these is NOT a Paladin skill?'),(458,'Which of these is NOT a Shade skill?'),(459,'Which of these is NOT a skill of a Battle Mage?'),(460,'Which of these is NOT a skill of a Cannoneer?'),(461,'Which of these is NOT a skill of a Marksman?'),(462,'Which of these is NOT a skill of a Mechanic?'),(463,'Which of these is NOT a skill of a Wind Archer?'),(464,'Which of these is NOT a skill of Mihile?'),(465,'Which of these is NOT a skill of Phantom?'),(466,'Which of these is NOT a skill of the Demon Slayer?'),(467,'Which of these is NOT a skill of the Night Walker?'),(468,'Which of these is NOT a skill of the Swordsman?'),(469,'Which of these is NOT a Zero skill?'),(470,'Which of these is NOT in Monster Life?'),(471,'Which of these items does NOT exist in MapleStory?'),(472,'Which of these items is NOT a consumable item?'),(473,'Which of these items is NOT a hand cannon?'),(474,'Which of these jobs does NOT exist in MapleStory?'),(475,'Which of these jobs is a part of the Cygnus Knights?'),(476,'Which of these jobs is a part of the Explorers?'),(477,'Which of these jobs is a part of the Legendary Heroes?'),(478,'Which of these jobs is a part of the Nova race?'),(479,'Which of these jobs is a part of the Resistance?'),(480,'Which of these monsters does NOT exist in MapleStory?'),(481,'Which of these monsters is NOT a canine?'),(482,'Which of these monsters is NOT a Mammal?'),(483,'Which of these monsters is NOT a plant?'),(484,'Which of these monsters is NOT a reptile?'),(485,'Which of these monsters is NOT enchanted?'),(486,'Which of these monsters is NOT from the Nihal Desert?'),(487,'Which of these monsters is NOT in the Tower of Oz?'),(488,'Which of these monsters is NOT live in the sea?'),(489,'Which of these monsters is NOT undead?'),(490,'Which of these people is NOT a resident in MapleStory?'),(491,'What\'s the name of public service worker in Kerning City Subway ?');
